import React from 'react';
import Navbar from './layouts/Navbar.component';
import 'bootstrap/dist/css/bootstrap.css';
import { Routes, Route } from 'react-router-dom';
import CreateAuthor from './components/CreateAuthor.component';
import EditBook from './components/EditBook.component';
import CreateBook from './components/CreateBook.component';
import Footer from './layouts/Footer';
import Login from './pages/Login';
import Home from './pages/Home';
import AppRoutes from './layouts/AppRoutes';

function App() {
  return (
    <React.Fragment>
      <Navbar />
      <Login />
      <Routes>
        {AppRoutes.map((route, index) => {
          const { element, ...rest } = route;
          return <Route key={index} {...rest} element={element} />;
        })}
      </Routes>
      <Footer />
    </React.Fragment>
  );
}

export default App;
